import React, { PureComponent } from './node_modules/react'
import styles from './styles'
import { styled } from './node_modules/styletron-react'

const StyledButton = styled('button', {
  ...styles.button,
  ...styles.primaryButton
})

export default class Button extends PureComponent {
  render() {
    const { onClick, type, style, children, ...rest } = this.props
    return (
      <StyledButton onClick={onClick} type={type} style={style} {...rest}>
        {children}
      </StyledButton>
    )
  }
}
